02-types/04-tableau.html.body:
tableau
Deux syntaxes : [] et Array.
let nombres1:number[] = [1, 2, 3];
let nombres2:Array = [1, 2, 3];

02-types/06-void.html.body:
void
Souvent utilisé en retour de méthode.
Deux valeurs possibles : undefined et null.
Exemple
let v1: void = undefined;
let v2: void = null;

02-types/07-any.html.body:
any
Peut-être de n’importe quel type.
Exemple
let a1: any = true;
a1 = "val";
a1 = 2;

02-types/08-enum.html.body:
enum
Enumération (liste fixe de valeurs).
Elle représente dans valeurs numériques numérotées à partir de 0.
enum Civilite {Monsieur, Madame, Mademoiselle};

let c1:Civilite = Civilite.Monsieur;

// 1,2,3
enum Civilite1 {Monsieur=1, Madame, Mademoiselle};

// 1, 10, 100
enum Civilite2 {Monsieur=1, Madame=10, Mademoiselle=100};

// recherche par valeur
let valEnum:string = Civilite2[10];

