02-types/10-fonction.html.body:
Fonction
Les paramètres et le retour d’une fonction peuvent être typés.
function rechercher(titreLivre:string): Livre {
    // ... recherche de livre
    return new Livre();
}

function publier(livre:Livre): void {
    // ... publication
}

Par défaut, tous les paramètres sont obligatoires.
Pour rendre un paramètre optionnel :

Mot clé ?
Si aucune valeur n’est passée, elle vaut undefined.

function publish(enligne?:boolean):void {
    // ...
}

02-types/11-interface.html.body:
Interface
Créer et faire appliquer un contrat.
function publier(livre:{published:boolean}):void {
    // ... publication
    livre.published = true;
}

Mot clé interface
interface Publiable {
    published: boolean;
}
function publish(livre:Publiable):void {
    // ... publication
    livre.published = true;
}

Interface & héritage

Mot clé extends

interface Publiable {
    publie: boolean;
}

interface Editable {
    edite: boolean;
}

interface Livre extends Publiable, Editable {
}

02-types/12-classe.html.body:
Classe
Type personnalisé.
class Livre {

}

let nouveauLivre:Livre = new Livre();

Une classe peut avoir des propriétés.
Elles sont publiques par défaut.
class Personne {
    nom:string;
    prenom:string;
}

La visibilité d’une propriété peut être modifiée via les mots clés :

public
private
protected

class Personne {
    public nom:string;
    private _secret:string;

    protected getNomComplet():string {
        return `nom ${this._secret}`;
    }
}

Une classe abstraite peut-être créée via le mot clé abstract.
abstract class BaseObject {
    abstract getId(): number;
}
class Personne extends BaseObject {
    private _id:number;
    public nom:string;
    private _secret:string;

    getId():number {
        return this._id;
    }
}

Notation raccourci pour déclarer la visibilité des membres via le constructeur.
class Personne {
    constructor(private _id:number, public nom:string, private _secret:string) {
    }

    protected getNomComplet():string {
        return `nom + ${this._secret}`;
    }
}

Une classe peut implémenter une interface via le mot clé implements.
Une classe peut implementer plusieurs interfaces.
interface Publiable {
    published: boolean;
    publish():void;
}
class Livre implements Publiable {
    published:boolean;

    publish():void {
        // publication ...
    }
}

04-decorateur/.body:
Décorateurs

Fonctionnalité ajoutée en TypeScript 1.5
Permet de faire de la méta- programmation
Préfixés par @, il ressemble aux annotations Java ou C#
Peut s’ajouter à une méthode, un attribut ou une classe
Proposé à une standardisation (ES7/ES2016 ?)

class Personne {

    @Audit()
    getAdresse() {
    // ...
    }

}
